\f0\fs64 \cf2 A 
\f1\b comprehensive software index
\f0\b0  could make it easier to find software by providing pertinent results organized with contextual information and specific details about each software resource. This would help users find software more effectively and compare alternatives more systematically.\
Past cataloguing efforts have failed either because they were simplistic (thus providing incomplete, misleading or unhelpful content) or relied on humans. Humans don\'92t scale\'97
\f1\b automation is the only feasible way
\f0\b0  of cataloging the vast and ever-growing number of constantly-evolving software applications, libraries and other sources.}

